import React from 'react';
import './App.css';

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <DragableDiv value="test"/>
        </header>
      </div>
    );
  }
}


function DragableDiv(content) {
  return (
    <div id="dragable_div">
      <div id="mydivheader">{content.value}</div>
    </div>
  )
}
export default App;
